import {Feature, FeatureCollection, Position} from './geojson';


/**
 * Returns a feature describing a neighbourhood in Utrecht by name.
 * @param {string} name
 * @return {Feature}
 */
export const getUtrechtNeighbourhoodByName = (name: string): Feature | null => {
  return UtrechtNeighbourhoods.features.find((feature: Feature) => {
    return String(feature.properties.name).toLowerCase() === name.toLowerCase();
  }) || null
}

/**
 * Returns features describing neighbourhoods in Utrecht, excludes neighbourhood by name.
 * @param {string} name
 * @return {Feature[]}
 */
export const excludeUtrechtNeighbourhoodByName = (name: string): Feature[] => {
  return UtrechtNeighbourhoods.features.filter((feature: Feature) => {
    return String(feature.properties.name).toLowerCase() !== name.toLowerCase();
  });
}

